```c++
#include <bits/stdc++.h>
using namespace std;

#define endln '\n'
#define print(x) cout << (x) << endln
#define each(a, x) for(auto &&a : x)
using ll = long long;
using vi = vector<int>;

struct diacc {
    int lp = -1, rp = -1;
    vector<int> distl, distr;
};

const int MAXN = 1e5+5;
vi adj[MAXN];

int n;

diacc build(int i) {
    vi d(n, -1);
    diacc ret;
    auto dfs = [&](int x, int dx, auto &&dfs) -> void {
        if (d[x] != -1) return;
        d[x] = dx;
        for (int y : adj[x]) dfs(y, dx+1, dfs);
    };
    dfs(i, 0, dfs);
    ret.lp = max_element(d.begin(), d.end())-d.begin();
    d = vi(n, -1);
    dfs(ret.lp, 0, dfs);
    ret.distl = d;
    ret.rp = max_element(d.begin(), d.end())-d.begin();
    d = vi(n, -1);
    dfs(ret.rp, 0, dfs);
    ret.distr = d;
    return ret;
}

void solve() {
    cin >> n;
    int q; cin >> q;
    for (int i = 0; i < n-3; i++) {
        int x,y; cin >> x >> y;
        x--, y--;
        adj[x].push_back(y);
        adj[y].push_back(x);
    }
    vector<diacc> cc(3);
    for (int i = 0; i < 3; i++) {
        int j = 0;
        if (i) {
            for (j = 0; j < n; j++) {
                bool bad = false;
                for (int k = 0; k < i; k++) {
                    if (cc[k].distr[j] != -1) bad=true;
                }
                if (bad == false) break;
            }
        }
        cc[i] = build(j);
    }
    while (q--) {
        int a,b; cin >> a >> b;
        a--, b--;
        int ai, bi;
        for (int i = 0; i < 3; i++) {
            if (cc[i].distl[a] != -1) ai = i;
            if (cc[i].distl[b] != -1) bi = i;
        }
        int ci = ai^bi^0^1^2;
        int ans = max(cc[ai].distl[a], cc[ai].distr[a]) + 3 + cc[ci].distl[cc[ci].rp] + max(cc[bi].distl[b], cc[bi].distr[b]);
        cout << ans << "\n"; 
    }
}
signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(NULL);
    solve();
}
```
